import Typed from "typed.js";

export default function heroLogic() {
  const dynamicTextOption = {
    strings: [
      "I am a nait graduate",
      "I am a coder",
      "I am a dungeon master",
      "I am a cat mom",
      "I am a coffee addict",
    ],
    typeSpeed: 80,
    backSpeed: 80,
    loop: true,
    smartBackspace: true,
    shuffle: true,
  };
}
